import Card from 'react-bootstrap/Card';
import Col from 'react-bootstrap/Col';
import Row from 'react-bootstrap/Row';
import { Link } from "react-router-dom";

import MainNavbar from '../MainNavbar.js';
import PastEvents from './PastEvents.js';

function Events() {

    return(
        <>
            <MainNavbar activeTab="/events"/>
            <div className="container section events">
                <div className="row">
                    <div className="col side-title">
                        <h3>Events</h3>
                        <hr/>
                    </div>
                </div>


                <div className="row upcoming-events">
                    <div className="col">
                    <h5>Upcoming events</h5>
                        <Row xs={1} md={2} className="g-4">
                            {Array.from({ length: 2 }).map((_, idx) => (
                                <Col key={idx}>
                                <Card className="event-card">
                                    <Card.Img variant="top" src={img1} />
                                    <Card.Body>
                                    <Card.Title>CME Talk for Doctors: The Sporting Knee</Card.Title>
                                    <Card.Text>
                                        This is a longer card with supporting text below as a natural
                                        lead-in to additional content. This content is a little bit
                                        longer.
                                    </Card.Text>
                                    </Card.Body>
                                </Card>
                                </Col>
                            ))}
                        </Row>
                    </div>
                </div>

                <PastEvents/>

            </div>
        </>
    );
}

export default Events;
